import React from 'react'
import { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import SectionOneCard from './SectionOneCard'
import SectionText from './SectionOneText'
import { getOurCards } from '../../../Actions/MainActions'

function SectionOne() {
    const ourCards = useSelector(state => state.Data.ourCards)
    const dispatch = useDispatch()

    useEffect(()=>{
        dispatch(getOurCards())
    },[])

  return (
    <div>
        <SectionText/>
        <div className="section-container-our">
            <SectionOneCard
            sectionImg1CardOne={ourCards.img1}
            sectionTitle1CardOne={ourCards.title1}
            />
            <SectionOneCard
            sectionImg2CardOne={ourCards.img2}
            sectionTitle2CardOne={ourCards.title2}
            />
            <SectionOneCard
            sectionImg3CardOne={ourCards.img3}
            sectionTitle3CardOne={ourCards.title3}
            />
        </div>
    </div>
  )
}

export default SectionOne
